//import logo from './logo.svg';
import './App.css';
//import ReclamacoesComponent from './components/ReclamacoesComponent';
import CategoriasComponent from './components/CategoriasComponent';
import React, { Component } from 'react'


class App extends Component {
  state = {
    categorias: []
  };

  async componentDidMount() {
    const response = await fetch('http://localhost:8082/safecity/v1/categorias');
    const body = await response.json();
    this.setState({categorias: body});
  }

  render() {
    const {categorias} = this.state;
    return (
        <div className="App">
          <header className="App-header">

            <div className="App-intro">
              <h2>Categorias</h2>
              {categorias.map(categorias =>
                  <div key={categorias.id}>
                    {categorias.descricaoCategoria} ({categorias.dataCadastro})
                  </div>
              )}
            </div>
          </header>
        </div>
    );
  }
}
export default App;
